    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
  } from "@mui/material";

function NavBar() {
    return(
        <AppBar>
            <Toolbar>
                <IconButton>
                    <h1>icon</h1>
                </IconButton>
                <Stack direction="row" spacing={2}>
                    <IconButton>
                        <h1>icon</h1>
                    </IconButton>
                    <IconButton>
                        <h1>icon</h1>
                    </IconButton>
                </Stack>
            </Toolbar>
        </AppBar>
    );
};
export default NavBar;
